  <style>
    .btn {
      border-width: 2px;
      border-radius: 100px;
    }

    .wf-viewport {
      left: 0;
      right: 0;
      bottom: 0;
      top: 0;
      position: fixed;
      overflow: auto;
    }

    #diagram {
      transition: transform .8s;
      transform: translateX(-100%);
      background: #FFF;
      border-right: 1px solid #CCC;
    }

    .wf-btn-diagram,
    .wf-diagram-message {
      transition: transform .6s;
    }

    .wf-diagram-opened #diagram {
      transform: translateX(0);
    }

    .wf-diagram-opened .wf-btn-diagram,
    .wf-diagram-opened .wf-diagram-message {
      transform: translateX(-150%);
    }

    .wf-started .wf-diagram-message {
      display: none;
    }

    #diagram:not(.wf-maximize)>div {
      display: flex;
      align-items: center;
      justify-content: center;
    }

    #diagram:not(.wf-maximize) svg {
      flex: 1;
    }

    #diagram:not(.wf-maximize) #minimize {
      display: none;
    }

    #diagram.wf-maximize svg {
      width: 4208px;
    }

    #diagram.wf-maximize #maximize {
      display: none;
    }

    #diagram #close {
      position: fixed;
      right: 15px;
      top: 15px;
      width: 30px;
      height: 30px;
      text-align: center;
      padding: 0;
    }

    #diagram #maximize,
    #diagram #minimize {
      position: fixed;
      right: 84px;
      top: 15px;
      padding: 11px 14px;
    }

    #workflow>svg {
      height: 100vh;
    }

    #workflow>svg use+g {
      pointer-events: none;
    }

    .link {
      cursor: pointer;
    }
  </style>
